import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
    return (
        <div className="app">
            <div className="inner-wrapper">
                <form name="crwaler-form">
                    <input id="crwal" type="text" name="input"/>
                    <button>Crawl</button>
                </form>
                <textarea name="output" id="output"/>
            </div>
        </div>
    );
}

export default App;
